const { jsPDF } = require("jspdf");
const fs = require('fs');

const images = {
    logo: "data:image/png;base64,",

    header_circle: "data:image/png;base64,",

}

const data = {
    name: 'spectory OG',
    url: 'https://www.spectory.at/',
    person: {
        first_name: 'Michal',
        last_name: 'Stencel',
    },
    stats: {
        gtm: true,
        linkedin_inisght_tag: true,
        metapixel: false,
        performance: 89,
        seo: 56,
        accessibility: 23
    }
}

const date_ob = new Date();
let date = ("0" + date_ob.getDate()).slice(-2);
let month = ("0" + (date_ob.getMonth() + 1)).slice(-2);
let year = date_ob.getFullYear();
let hours = date_ob.getHours();
let minutes = date_ob.getMinutes();

const date_string = `${date}.${month}.${year} ${hours}:${minutes}`


const Avenir_Heavy = fs.readFileSync('./fonts/Avenir-Heavy.ttf', 'latin1')
const Avenir_Roman = fs.readFileSync('./fonts/Avenir-Roman.ttf', 'latin1')

// Default export is a4 paper, portrait, using millimeters for units
const doc = new jsPDF();
// Schriftarten hinzufügen: Avenir Roman
doc.addFileToVFS("Avenir-Roman.ttf", Avenir_Roman);
doc.addFont("Avenir-Roman.ttf", "Avenir Roman", "normal");


// Schriftarten hinzufügen: Avenir Heavy
doc.addFileToVFS("Avenir-Heavy.ttf", Avenir_Heavy);
doc.addFont("Avenir-Heavy.ttf", "Avenir Heavy", "normal");

// Header
doc.addImage(images.logo, 10, 10, 30, 10);
doc.addImage(images.header_circle, 160, -20, 80, 80);

doc.setFont("Avenir Heavy");
doc.setFontSize(20);
doc.text('Digital Recruiting Index', 65, 17);



// Summary

//// Links
doc.setFont("Avenir Roman");
doc.setFontSize(12);
doc.text(`Übersicht für`, 11, 40);
doc.text(`Beantragt von`, 11, 48);
doc.text(`Erstellt am`, 11, 56);

//// Rechts
doc.setFont("Avenir Heavy");
doc.text(data.name, 60, 40);
doc.text(`${data.person.first_name} ${data.person.last_name}`, 60, 48);
doc.text(date_string, 60, 56);

// Stats

doc.setFontSize(18)
doc.text('Webseite', 11, 75);

//// Spalte #1

doc.setFontSize(12)
doc.setFont("Avenir Roman");
doc.text('Google Tag Manager:', 11, 90);
doc.text('LinkedIn Insight Tag:', 11, 98);
doc.text('Meta Pixel:', 11, 106);

//// Spalte #2

doc.setFont("Avenir Heavy");
doc.setTextColor(data.stats.gtm ? '#05800f' : '#9c0c11');
doc.text(data.stats.gtm ? 'JA' : 'NEIN', 61, 90);

doc.setTextColor(data.stats.linkedin_inisght_tag ? '#05800f' : '#9c0c11');
doc.text(data.stats.linkedin_inisght_tag ? 'JA' : 'NEIN', 61, 98);

doc.setTextColor(data.stats.metapixel ? '#05800f' : '#9c0c11');
doc.text(data.stats.metapixel ? 'JA' : 'NEIN', 61, 106);

//// Spalte #3
doc.setTextColor('#000');
doc.setFont("Avenir Roman");
doc.text('Leistung:', 110, 90);
doc.text('Barrierefreiheit:', 110, 98);
doc.text('SEO:', 110, 106);

//// Spalte #4
doc.setFont("Avenir Heavy");
doc.setTextColor(data.stats.performance > 75 ? '#05800f' : data.stats.performance > 50 ? '#c4bf1d' : '#9c0c11');
doc.text(`${data.stats.performance}`, 160, 90);
doc.setTextColor(data.stats.accessibility > 75 ? '#05800f' : data.stats.accessibility > 50 ? '#c4bf1d' : '#9c0c11');
doc.text(`${data.stats.accessibility}`, 160, 98);
doc.setTextColor(data.stats.seo > 75 ? '#05800f' : data.stats.seo > 50 ? '#c4bf1d' : '#9c0c11');
doc.text(`${data.stats.seo}`, 160, 106);




// PDF erstellen und speichern
doc.save(`./pdf_archive/${data.name.toLowerCase().replace(' ', '-')}.pdf`);